  `balance` double DEFAULT '0',
  `joining_date` varchar(45) DEFAULT NULL,
  `phone1` varchar(18) DEFAULT 'None',
  `phone2` varchar(18) DEFAULT 'None',
  `fax1` varchar(20) DEFAULT 'None',
