declare sellPrice, rate double;
declare orderTableId int(18);

-- Main Str
set idx = locate(';', stringArray, 1);
set preIdx = 1;

WHILE idx > 0 DO 

set strBlock = substr(stringArray, preIdx, idx - preIdx);

	-- Block Str
    set preIdx1 = 1;
	set idx1 = locate(',', strBlock, 1);	
