    set preIdx1 = idx1 + 1;
    set idx1 = locate(',', strBlock, preIdx1);
    set sellPriceStr = substr(strBlock, preIdx1, idx1 - preIdx1);
    set sellPrice = cast(sellPriceStr as decimal(10,2));
    
    set preIdx1 = idx1 + 1;
    set idx1 = locate(',', strBlock, preIdx1);
